завтрак, обед, ужин — буфет («шведский стол»), свободная рассадка;
в каюте - бутилированная питьевая вода (в день посадки);
приветственный коктейль;
заключительный капитанский коктейль;
холодильники, телевизоры и фены во всех каютах;
завтрак, обед – буфет («шведский стол»), фиксированная рассадка, ужин «ШЕФ – МЕНЮ» – заказная система с включенными напитками (вода, чай, кофе, на выбор: сок, вино красное / белое, пиво), фиксированная рассадка (за дополнительную плату, количество мест ограничено);
радиогид на время береговых экскурсий (за дополнительную плату).

